if(typeof jQuery=="undefined"){var s=document.createElement("script");s.type="text/javascript";s.src="https://cdn.bootcss.com/jquery/2.1.4/jquery.js";document.getElementsByTagName("HEAD").item(0).appendChild(s);setTimeout("dl()",100)}else{dl()}var prev="";var cs=0;function dl(){var e=false;var t=$(".x-list-plain").length-1;var n=$($(".x-list-plain")[t]).children();n.each(function(t,n){if(t==0){var l=$(n).html();if(l==prev){e=true;return false}prev=l}if(!$(n).is(".x-boundlist-selected")){$(n).click()}});if(e){return false}var t=$(".x-tbar-page-next").length-1;if(t<=3){return false}$(".x-tbar-page-next")[t].click();cs=(new Date).getTime()/1e3;check()}function check(e){var t=(new Date).getTime()/1e3;if(t>cs+5){console.log("超过5秒,自动提交");var n=$(".x-btn-default-small-noicon").length;$(".x-btn-default-small-noicon")[n-1].click();return false}var e=$(".x-list-plain").length-1;var l=$($(".x-list-plain")[e]).children();setTimeout(function(){if(l[0].innerHTML==prev){check()}else{console.log("new:"+l[0].innerHTML);dl()}},500)}